e constraints of online dating. \n\nI believe my person is out there. This is a signal to the universe to put us in touch ✨🙏🏼\n\n\u0010\u0012\u001c→ Get in touch with me here\n\u0011\n\u0011Jump links\nWhat I’m looking for (high level) \nShe + Me: specifics and logistics\nWant to connect? \nSome extra pics\nGet to know me\nI’m a curious, positive, philosophical type of guy based in Los Angeles who enjoys a healthy lifestyle full of meaningful connection. \nBy day I work as a designer at a financial tech company. By night I write about life and money and enjoy creating content.\nI just as much enjoy talking about personal finance as I am about plant medicine. Deep, wide-ranging conversations really feed my soul. \nLife is an adventure, and I’m ready to share it with a plus one!\n→ I’m into…\nPersonal growth \u0026 development. I read a lot of nonfiction and try to balance it out with science fiction and poetry. \nMy Four Tendency type is The Questioner; I love asking “Why?” I tend to work well with other Questioners and Upholders.  \nLoves: coffee, cocktails, beach paths, group trips, behavioral psychology podcasts like Hidden Brain\nHealth: lifting weights, pickleball, running. Not a “sports guy” but I’m into being active. I enjoy meditation, breathwork, yoga.\nWriting, content creation, the creator economy\n→ What I offer in relationship\nAffectionate, encouraging, positivity, structure\nAdventure partner good at balancing planning \u0026 spontaneity \nMaturity: can hold space, navigate conflict, always willing to create space and see another point of view.\nGood at taking care of myself and fostering a healthy environment for mutual growth. You’ll be invited to try new things with me and I love that energy too.\n→ My dreams\nCreate a close-knit community where everyone is always invited to our home. Host events and have group adventures.\nTake a 3-6 month sabbatical to travel the world with my boo \nDo content creation full-time; publish a book \nHelp people achieve financial literacy + independence \n→ Conversation starters\nWhat’s a country or destination you’d return to over and over again?\nWhich personality quiz (enneagram, Myers-Briggs) do you find most useful? What is it? \nWhat topics fascinate you that you could talk for hours about?\nWho or what are you most grateful for in life? \nWhat I’m looking for at a high level\nI’m looking for a creative co-inspirator in life with qualities like:\nPositivity + gratitude: a sunny disposition makes the world go round.\nRange: We can talk about anything and laugh a lot along the way. We are goofballs, lovers, nerds, hippies, professionals and creatives. \nResourcefulness: We have a “willing to figure it out” spirit, whether that’s upgrading our habits or making the most of a long airport layover.\nCuriosity + loves to learn: we’re inquisitive about the world and each other. We share podcasts, life hacks, geek out on philosophy \u0026 lifestyle design.\nWhen I meet her, there will be an expansive feeling of possibility, like “Wow, I feel like I can do anything with this person!” \n→ Bonus points: (not requirements but big signals for compatibility)\nYou’ve done personal development training like Landmark, Tony Robbins, yoga teacher training, etc \nYou’re pursuing financial freedom (F.I.R.E. movement) \nYou’ve “done the work” spiritually. No one’s perfect but you’re aware of your shadow(s) and take accountability for them. \nShe + Me: Lifestyle Specifics\nLOCATION\nWithin Los Angeles but I’m open to further for an exceptional match.\nIf not in LA, most important is trajectory: she has, or will soon have, the freedom, desire or ability to be in LA, and/or be mobile. I’d love for SoCal to be our home base while having the option to be remote later on.\nAGE\nMe: 35. She’s mid 20s - early 30s. The most important thing is that she’s factored kids into dating. Example: I’m open to dating someone older if she froze her eggs or is planning to do it. \n"},{"ty":"as","st":"document","si": ve on interpersonal dynamics. \nMARRIAGE \nSpiritually—definitely yes. Open to legal marriage too, though I see that more as a formal contract. It’s okay if my soulmate was married in the past as long as the healing and learning has been done. \nETHNICITY \u0026 “TYPE” \nI tend to connect best with well traveled people with international exposure, fellow immigrants, and diverse backgrounds. Someone with a wide range of life experience \u0026 friendships is more important than ethnicity.\nSUBSTANCES\nI occasionally drink, use weed (edibles), use plant medicine, and I don’t smoke. My soulmate is OK being with someone who uses psychedelics responsibly. Bonus if she has experience 🍄. My soulmate does not smoke, nor heavily uses substances. Moderation \u0026 health are key.\nMONEY, CAREER AND FINANCE\nThe degree to which my partner is resourceful and self-reliant is the degree to how confident I feel like we can BUILD together. I look for qualities like: \nResponsible with money or have literacy/fluency in this category\nWorks hard, is resourceful, has plans to achieve goals\nIs naturally helpful and easefully shares in the upkeep of a household \nMy single mother worked hard to become financially free, and my sisters are both heads of their households. While I definitely don’t expect the same, these experiences have shaped my egalitarian views. \nI believe good partnership requires 2 conscientious, thoughtful partners who recognize each other’s strengths and can lean on each other.\nExample: I’m good at initiating and creating an initial plan, and work well with someone good with details. \nUltimately looking for those that see partnership as a way to join forces to create something bigger. Like going in on an investment property, supporting each other’s career journeys, and growing our community. \nOTHER LIFESTYLE PREFERENCES \u000bI don’t mind as long as I have the freedom to practice mine: \nPolitics: I’m liberal to moderate looking for same. I don’t do extremes. \nR
